import { Injectable } from '@angular/core';
import * as L from 'leaflet'
import {Place} from "../model/place";
import {LatLngExpression} from "leaflet";
@Injectable({
  providedIn: 'root'
})
export class MapMarkerService {

  constructor() { }
  makeMarkers(map: L.Map, elements: Place): void{
      const lon=elements.coordinate_x
      const lat=elements.coordinate_y
      const marker=L.marker([lat,lon] as LatLngExpression)

      marker.addTo(map);
  }
}
